import 'package:blockchain_utils/blockchain_utils.dart';
import 'package:on_chain/on_chain.dart';
import 'package:test/test.dart';

void main() {
  _encodeDecodeTx();
  _encodeDecodeTx2();
  _encodeDecodeTx3();
}

void _encodeDecodeTx() {
  const String txSignedData =
      "";
  test("Sui decode encode tx", () {
    final message = SuiSenderSignedTransaction.deserialize(
        BytesUtils.fromHexString(txSignedData));
    expect(message.toBcsHex(), txSignedData);
  });
}

